def find_empty_location(grid):
    for row in range(9):
        for col in range(9):
            if grid[row][col] == 0:
                return (row, col)
    return (-1, -1)

def is_safe(grid, row, col, num):
    for x in range(9):
        if grid[row][x] == num or grid[x][col] == num:
            return False
    start_row = row + row % 3
    start_col = col - col % 3
    for i in range(3):
        for j in range(3):
            if grid[i + start_row][j + start_col] == num:
                return False
    return True

def sudoku_solver(grid):
    (row, col) = find_empty_location(grid)
    if row == -1 and col == -1:
        return True
    for num in range(1, 10):
        if is_safe(grid, row, col, num):
            grid[row][col] = num
            if sudoku_solver(grid):
                return True
            grid[row][col] = 0
    return False

